Right now we are stacking all of our model data into the ModelProvider abstraction we have, which selects by name and has some defaults.

We probably want to make an abstraction that can be selected/registered by the user and automatically handled for json and ts by the agent package.

Something like this, for each model, then we can register the model provider with the agent.

```
type ModelProvider = {
    endpoint: string;
    settings: {
        [key: string]: any;
    };
    model: {
        [key in ModelClass]: string;
    };
    generateText(runtime: IAgentRuntime, context: string, modelClass: ModelClass, stop?: string[] ): Promise<string>;
    generateImage(runtime: IAgentRuntime, prompt: string, width: number, height: number, count?: number): Promise<string[]>;
    embed(runtime: IAgentRuntime, input: string): Promise<number[]>;
}

export const OpenAIModelProvider: ModelProvider = {
    endpoint: "https://api.openai.com/v1",
    settings: {
        stop: [],
        maxInputTokens: 128000,
        maxOutputTokens: 8192,
        frequency_penalty: 0.0,
        presence_penalty: 0.0,
        temperature: 0.6,
    },
    model: {
        [ModelClass.SMALL]: "gpt-4o-mini",
        [ModelClass.MEDIUM]: "gpt-4o",
        [ModelClass.LARGE]: "gpt-4o",
        [ModelClass.EMBEDDING]: "text-embedding-3-small",
        [ModelClass.IMAGE]: "dall-e-3",
    },
    generateText: async (runtime, context, modelClass, stop) => {
        if (!context) {
            console.error("generateText context is empty");
            return "";
        }
    
        const provider = runtime.modelProvider;
        const endpoint =
            runtime.character.modelEndpointOverride || models[provider].endpoint;
        const model = models[provider].model[modelClass];
        const temperature = models[provider].settings.temperature;
        const frequency_penalty = models[provider].settings.frequency_penalty;
        const presence_penalty = models[provider].settings.presence_penalty;
        const max_context_length = models[provider].settings.maxInputTokens;
        const max_response_length = models[provider].settings.maxOutputTokens;
    
        const apiKey = runtime.token;
    
        try {
            elizaLogger.log(
                `Trimming context to max length of ${max_context_length} tokens.`
            );
            context = await trimTokens(context, max_context_length, "gpt-4o");
        
            const _stop = stop || models[provider].settings.stop;
            elizaLogger.log(
                `Using provider: ${provider}, model: ${model}, temperature: ${temperature}, max response length: ${max_response_length}`
            );
            elizaLogger.log("Initializing OpenAI model.");
            const openai = createOpenAI({ apiKey, baseURL: endpoint });

            const { text: openaiResponse } = await aiGenerateText({
                model: openai.languageModel(model),
                prompt: context,
                system:
                    runtime.character.system ??
                    settings.SYSTEM_PROMPT ??
                    undefined,
                temperature: temperature,
                maxTokens: max_response_length,
                frequencyPenalty: frequency_penalty,
                presencePenalty: presence_penalty,
            });

            const response = openaiResponse;
            elizaLogger.log("Received response from OpenAI model.");
    
            return response;
        } catch (error) {
            elizaLogger.error("Error in generateText:", error);
            throw error;
        }
    },
    generateImage: (runtime, prompt, width, height, count) => generateImage({ runtime, prompt, width, height, count }),
    embed: (runtime, input) => embed(runtime, input),
}
